description:
Misaka Mikoto: “Misaki, tới chính diện bên trên ta nha!” Pháo tỷ mặt mũi tràn đầy ngượng ngùng;

Fate: “Là tỷ muội a!” Sủng phi nghĩa chính từ nghiêm;

Hyuga Hinata: “.......” Thái Tử Phi đỏ mặt ngất đi;

Cho nên đây là một cái nhân vật chính xuyên qua đến Anime, trở thành nhân vật nữ chính muội muội, đồng thời bị phản công lược cố sự.
